            style={{
              gridColumn: "1 / 7",
              gridRow: "2 / 7",
              textAlign: "center",
            }}
          >
            <div id="flexContainerItemCardMyGoals">
              <ItemCard
                style={{
                  width: "150px",
                  height: "150px",
                  padding: "10px",
                  textAlign: "center",
                }}
