                <h4>Apprendre l'anglais</h4>
                <div
                  className="ContainerCircularProgressBar"
                  style={{ width: 75, height: 75 }}
                >
                  <CircularProgressbar
                    value={percentage}
                    text={`${percentage}%`}
                    strokeWidth={18}
                    styles={buildStyles({
                      rotation: 0.25,
                      strokeLinecap: "butt",
                      textSize: "16px",
