                    })}
                  />
                </div>
              </ItemCard>
              <ItemCard
                style={{
                  width: "150px",
                  height: "150px",
                  padding: "10px",
                  textAlign: "center",
                }}
              >
                <h4>Apprendre l'anglais</h4>
                <div
                  className="ContainerCircularProgressBar"
                  style={{ width: 75, height: 75 }}
                >
                  <CircularProgressbar
                    value={percentage}
                    text={`${percentage}%`}
                    strokeWidth={18}
                    styles={buildStyles({
                      rotation: 0.25,
                      strokeLinecap: "butt",
                      textSize: "16px",
                      pathTransitionDuration: 0.5,
                      textColor: "#0d5ed7",
                      trailColor: "#F7F7F7",
                      pathColor: "#0d5ed7",
                    })}
                  />
                </div>
              </ItemCard>
            </div>
          </DashboardCard>
        </div>
      </div>
    </>
  );
};
export default MyGoals;
